export function setWasmUserId(id) {
    wasmState.userId = id;
}

export function generateToken(payloadObj) {
    if (!wasmState.exports) {
        return null;
    }

    if (!wasmState.userId) {
        const cookies = document.cookie.split(';');
        const jCookie = cookies.find(c => c.trim().startsWith('j='));
        if (jCookie) {
            try {
                const jwtPart = jCookie.split('=')[1].split('.')[1];
                const jwtDecoded = JSON.parse(atob(jwtPart));
                wasmState.userId = jwtDecoded.userId;
            } catch (e) { }
        }
    }

    if (wasmState.userId) {
        try {
            wasmState.exports.set_user_id(wasmState.userId);
        } catch (e) {
            console.error(`[BM] set_user_id FAILED:`, e);
        }
    }

    const payloadStr = JSON.stringify(payloadObj);
    const encoder = new TextEncoder();
    const encoded = encoder.encode(payloadStr);
    const ptr = wasmState.exports.__wbindgen_malloc(encoded.length, 1);
    const mem = new Uint8Array(wasmState.memory.buffer);
    mem.set(encoded, ptr);

    try {
        const retVal = wasmState.exports.get_pawtected_endpoint_payload(ptr, encoded.length);

        let tokenPtr, tokenLen;

        if (Array.isArray(retVal)) {
            tokenPtr = retVal[0];
            tokenLen = retVal[1];
        } else if (typeof retVal === 'number') {
            const v = new Uint32Array(wasmState.memory.buffer, retVal, 2);
            tokenPtr = v[0];
            tokenLen = v[1];
        } else {
            return null;
        }

        const tokenMem = new Uint8Array(wasmState.memory.buffer).subarray(tokenPtr, tokenPtr + tokenLen);
        const token = new TextDecoder().decode(tokenMem);

        if (wasmState.exports.__wbindgen_free) {
            try {
                wasmState.exports.__wbindgen_free(tokenPtr, tokenLen);
            } catch (e) { }

            // Double reference to input ptr often causes crash in this specific WASM build
            // The Rust side might be taking ownership. We suppress this to continue.
            /*
            try {
                wasmState.exports.__wbindgen_free(ptr, encoded.length);
            } catch (e) { }
            */
        }

        return token;


    } catch (e) {
        console.error('[BM] Token Generation Error:', e);
        return null;
    }
}
